syntax = "proto3";

package ComponentIntegrityCollection;

import "NavigationReference.proto";
import "Resource_v1/Oem.proto";

message ComponentIntegrityCollection {
    // from Resource.v1_0_0.ResourceCollection
    string Description = 1;
    string Name = 2;
    .Resource.Oem Oem = 3;

    // from ComponentIntegrityCollection.ComponentIntegrityCollection
    repeated NavigationReference Members = 4;
}